//import { StatusBar } from "expo-status-bar";
import React, { useState } from "react";
import { StyleSheet, Pressable, Text, View, Modal } from "react-native";

export default function ModalItem({ modalVisible, setModalVisible }) {
  return (
    <Modal
      animationType="slide"
      visible={modalVisible}
      transparent
      onRequestClose={() => {
        setModalVisible(false);
      }}
    >
      <View style={styles.modalContainer}>
        <View style={[styles.modalContent, styles.shadow]}>
          <Text style={styles.modalMessage}>
            Esta seguro que desea borrar este elemento?
          </Text>
          {/*<Text style={styles.modalTitle}>{itemSelected.value}</Text>*/}
          <View>
            <Pressable>Confirmar</Pressable>
          </View>
        </View>
      </View>
    </Modal>
  );
}

const styles = StyleSheet.create({
  modalContent: {},
  modalContainer: {},
  modalMessage: {},
  modalTitle: {},
});
